import React, { useState } from 'react';
import {
  popup,
  ModelXmlSerializer,
  domUtils,
  styleUtils,
  mathUtils,
  cloneUtils,
  eventUtils,
  Graph,
  InternalEvent,
  RubberBandHandler,
  ConnectionHandler,
  ConnectionConstraint,
  Point,
  CylinderShape,
  CellRenderer,
  DomHelpers,
  EdgeStyle,
  Rectangle,
  EdgeHandler,
  StyleRegistry,
  EdgeSegmentHandler,
  UndoManager,
  CellEditorHandler,
  ConstraintHandler,
  Guide,
  ImageBox,
  GraphView,
  SelectionHandler,
  PanningHandler,
  TooltipHandler,
  SelectionCellsHandler,
  PopupMenuHandler,
  xmlUtils,
  Codec,
} from '@maxgraph/core';
import GraphComponent, { FileUploader } from './components/GraphComponent'; 

export default function App() {

  const [graph, setGraph] = useState(
    new MyCustomGraph(container, null, [
      MyCustomCellEditorHandler,
      TooltipHandler,
      SelectionCellsHandler,
      PopupMenuHandler,
      MyCustomConnectionHandler,
      MyCustomSelectionHandler,
      MyCustomPanningHandler,
    ])
  );

  // Функция для изменения переменной graph
  const updateGraph = (newGraph) => {
    setGraph(newGraph);
  };
  return (
    <>
    <GraphComponent graph={graph} updateGraph={updateGraph} />
    <FileUploader graph={graph} updateGraph={updateGraph} />
    <FileUploader />
    <GraphComponent />

    </>
  );
}
